INSERT INTO `costs_administrative` VALUES (1,'Salário do Engenheiro Responsável','Remuneração do profissional técnico que gerencia e fiscaliza a obra.'),(2,'Salário de Mestre de Obras','Remuneração do profissional que coordena diretamente a execução da obra.'),(3,'Salário de Auxiliar Administrativo','Funcionário responsável por tarefas administrativas como controle de documentos.'),(4,'Contador / Escritório Contábil','Serviços de contabilidade para emissão de notas, folha de pagamento e tributos.'),(5,'Consultoria Técnica','Gastos com serviços especializados, como cálculo estrutural, projetos hidráulicos.'),(6,'Licenciamento e Taxas','Taxas para obtenção de alvarás e licenças junto à prefeitura e órgãos reguladores.'),(7,'Transporte Administrativo','Custos com deslocamento de equipe administrativa e supervisores.'),(8,'Materiais de Escritório','Papel, canetas, impressoras, pastas, carimbos e outros itens administrativos.'),(9,'Equipamentos de TI','Computadores, impressoras, softwares de gestão e manutenção de sistemas.'),(10,'Telefonia e Internet','Serviços de comunicação usados na administração da obra.'),(11,'Treinamentos e Capacitação','Cursos e formações para a equipe administrativa e técnica.'),(12,'Equipamentos de Proteção (EPI) Administrativo','EPIs para funcionários que não atuam diretamente na obra, como máscara e luvas.'),(13,'Despesas Bancárias','Tarifas para movimentação financeira, como DOCs, TEDs, boletos.'),(14,'Alimentação da Equipe Administrativa','Custos com alimentação ou vale-refeição para funcionários administrativos.'),(15,'Uniformes','Compra de roupas padronizadas para equipe administrativa e técnica.');
/*!40000 ALTER TABLE `costs_administrative` ENABLE KEYS */;
