INSERT INTO `costs_labor` VALUES (1,'Pedreiro','Executa alvenarias, rebocos, assentamento de pisos, revestimentos e acabamentos em geral.'),(2,'Servente de pedreiro','Auxilia o pedreiro no preparo de massas, transporte de materiais e limpeza do local de obra.'),(3,'Carpinteiro','Constrói e monta formas de madeira para concretagem, além de estruturas temporárias.'),(4,'Armador','Corta, dobra e monta ferragens para estruturas de concreto armado.'),(5,'Eletricista','Instala e repara fiações elétricas, quadros de distribuição e sistemas de iluminação.'),(6,'Encanador / Bombeiro hidráulico','Instala e mantém redes de água, esgoto, pias, vasos sanitários e sistemas hidráulicos.'),(7,'Pintor','Prepara superfícies e aplica tintas, vernizes e outros revestimentos.'),(8,'Gesseiro','Aplica gesso em paredes, tetos e realiza molduras e divisórias em drywall.'),(9,'Azulejista','Assenta cerâmicas, porcelanatos e outros revestimentos com precisão e acabamento.'),(10,'Mestre de obras','Supervisiona e coordena a execução da obra, orientando equipes e garantindo qualidade.'),(11,'Engenheiro civil','Planeja, projeta e gerencia obras, garantindo conformidade com normas técnicas.'),(12,'Técnico em edificações','Apoia engenheiros, fiscaliza obras, elabora orçamentos e acompanha cronogramas.'),(13,'Operador de betoneira','Manuseia betoneiras para preparo de concreto em canteiros de obras.'),(14,'Operador de máquina pesada','Conduz máquinas como escavadeiras, retroescavadeiras e tratores em obras.'),(15,'Topógrafo','Realiza medições de terrenos e elabora mapas e plantas para projetos de engenharia.'),(16,'Pintor de fachada','Trabalha com pintura de fachadas externas, muitas vezes em andaimes e plataformas elevadas.'),(17,'Rejuntador','Aplica rejunte em pisos e revestimentos, garantindo acabamento e vedação.'),(18,'Técnico de segurança do trabalho','Inspeciona as condições da obra para garantir segurança dos trabalhadores.');
/*!40000 ALTER TABLE `costs_labor` ENABLE KEYS */;
UNLOCK TABLES;

