INSERT INTO `costs_rental_equipment` VALUES (1,'Betoneira','Mistura cimento, areia, brita e água para formar o concreto de forma homogênea.'),(2,'Compactador de Solo (Sapo)','Compacta o solo em pequenas áreas, ideal para fundações, calçadas e valas.'),(3,'Rolo Compactador','Compacta grandes áreas de solo ou asfalto, muito usado em obras de pavimentação.'),(4,'Rompedor Hidráulico','Quebra concreto ou rochas usando pressão hidráulica, acoplado a escavadeiras.'),(5,'Martelete Elétrico','Quebra paredes ou pisos de concreto com impactos rápidos e fortes.'),(6,'Andaime Fachadeiro','Suporte modular usado para acesso a fachadas em reformas e construções.'),(7,'Escora Metálica','Sustenta vigas e lajes durante o processo de concretagem.'),(8,'Serra de Piso','Realiza cortes precisos em pisos de concreto ou asfalto.'),(9,'Gerador de Energia','Fornece energia elétrica em locais sem rede elétrica disponível.'),(10,'Lavadora de Alta Pressão','Remove sujeiras pesadas de pisos, paredes e máquinas com jatos de água pressurizados.'),(11,'Torre de Iluminação','Ilumina o canteiro de obras durante a noite, essencial para segurança e produtividade.'),(12,'Compressor de Ar','Gera ar comprimido para operar ferramentas pneumáticas como marteletes e pistolas.'),(13,'Mangote Vibrador','Vibra o concreto recém-aplicado, eliminando bolhas de ar e garantindo resistência.'),(14,'Guincho de Carga','Eleva materiais a andares superiores da obra com segurança.'),(15,'Talha Manual','Utilizada para içar materiais pesados em espaços limitados de forma manual.'),(16,'Placa Vibratória','Compacta pavimentos, calçadas e solo em áreas menores com maior precisão.'),(17,'Carrinho de Mão','Transporte manual de materiais leves como areia, cimento, ou entulho.'),(18,'Lixadeira de Parede','Alisa e nivela paredes de gesso ou reboco antes da pintura.'),(19,'Escada Extensível','Acesso a locais altos durante instalações, manutenções e pinturas.'),(20,'Pulverizador de Pintura','Aplica tinta de forma uniforme em grandes superfícies com rapidez.');
/*!40000 ALTER TABLE `costs_rental_equipment` ENABLE KEYS */;
