INSERT INTO `steps_work` VALUES (1,'Serviços preliminares','Limpeza e terraplenagem do terreno, demolições e sondagens do solo.'),(2,'Fundações','Estacas, sapatas, radier, blocos de fundação.'),(3,'Estrutura','Pilares, vigas, lajes e escadas, em concreto armado, metálica ou madeira, conforme projeto.'),(4,'Alvenaria','Levantamento das paredes, vedações e divisórias internas.\n\n'),(5,'Instalações','Elétricas, hidráulicas, sanitárias, gás e outras, passagens embutidas nas paredes e lajes.'),(6,'Cobertura','Estrutura do telhado (madeira ou metálica), telhamento (telhas cerâmicas, metálicas, fibrocimento, etc.).'),(7,'Esquadrias','Instalação de portas, janelas, venezianas, portões.'),(8,'Revestimentos','Internos e externos: reboco, gesso, massa corrida, cerâmicas, pintura, etc.'),(9,'Pisos e acabamentos','Porcelanato, cerâmica, laminado, cimento queimado, rodapés, louças, metais, móveis embutidos.');
